import './Ronds.scss';

export default function Ronds({width}){

    pxWidth = width + 'px';

    return (
        <div className="Ronds">
            <div className='rond rond1' style={{width: {pxWidth}, height: {pxWidth}}}>
                <div className='rond rond2' style={{width: "", height: "90px"}}></div>
            </div>
        </div>
    );
}
